const numbers = document.querySelectorAll(".count")
const beginYear = 2000
const endYear = 2018

function startAnimation() {
    numbers.forEach((number) => {
        if (number.classList.contains("animated")) {
            return
        }

        let speed = 20
        if (number.classList.contains("fast")) {
            speed = 1
        } else {speed = 30}

        const value = number.id
        if (number.getBoundingClientRect().top + 150 < window.innerHeight) {
            for (let i = 0; i <= value; i++) {
                setTimeout(() => {
                    number.innerHTML = i
                }, i * speed)
            }
            number.classList.add("animated")
        }
    })
}



function createVisualisation(data) {
    const visualisation = document.querySelector("#visualisation")
    let years = getPercentage(data, beginYear, endYear)
    years.forEach((year) => {
        const bar = document.createElement("div")
        bar.style.width = "10%"
        bar.classList.add("bar")
        bar.id = year.year
        bar.setAttribute("data-value", year.percentage)

        const p = document.createElement("p")
        p.textContent = year.year

        const img = document.createElement("img")
        img.src = "./img/arrow.svg"

        bar.appendChild(p)
        bar.appendChild(img)
        visualisation.appendChild(bar)
    })
}


function europeVote(data) {
    const votes = Object.entries(data)
    .filter(([key, value]) => typeof value === "string" && key !== "Resolution" && key !== "Description")
    .map(([key, value]) => value)
    let yes = 0
    let no = 0
    let abstain = 0
    votes.forEach((vote) => {
        if(vote === "Yes"){yes += 1}else if(vote ==="No"){no += 1}else if(vote === "Abstain"){abstain += 0}
    })
    // console.log(`yes: ${yes}    no: ${no}    abstain: ${abstain}`)
    if (yes > no){return("Yes")}else if(no > yes){return("No")}else{return("Abstain")}
}

function getPercentage(data, beginYear, endYear) {
    let percentages = []

    for (let year = beginYear; year <= endYear; year++){
        let dataOfYear = data.filter(item => item.Session === year - 1945)
        let similarityVoteCount = 0

        dataOfYear.forEach((resolution) => {
            let euVote = europeVote(resolution)
            let usaVote = resolution["United States of America"]
            if(euVote !== usaVote){similarityVoteCount += 1}
        })

        const percentageSimilarVotes = (similarityVoteCount / dataOfYear.length) * 100

        const yearData = {
            year: year,
            percentage: percentageSimilarVotes,
        }
        percentages.push(yearData)
    } 
    return percentages
}

function changeVoteName(data) {
    if(data === "Yes"){return(["Yay", "green"])}
    if(data === "No"){return(["Nay", "red"])}
    if(data === "Abstain"){return(["Abs.", "abs"])}
    if(data === "Absent"){return(["Abs.", "abs"])}
}

function addMetaDataYear() {
    const bars = document.querySelectorAll(".bar")
    const parentElement = document.querySelector("#metaDataYear")
    const table = document.querySelector("#info")
    bars.forEach((bar) => {
        bar.addEventListener("click", () => {
            let dataOfYear = data.filter(item => item.Session === bar.id - 1945)
            const order = document.querySelector("#sort").value
            let modifiedData = []
            dataOfYear.forEach((resolution) => {
                let newData = {
                    "resolution": resolution.Description,
                    "USAVote": changeVoteName(resolution["United States of America"])[0],
                    "USAClass": changeVoteName(resolution["United States of America"])[1],
                    "EUVote": changeVoteName(europeVote(resolution))[0],
                    "EUClass": changeVoteName(europeVote(resolution))[1]
                }
                modifiedData.push(newData)
            })
            modifiedData = sortResolutions(modifiedData, order)
            modifiedData.forEach((resolution) => {
                const title = document.createElement("p")
                title.textContent = resolution.resolution.split(":")[0]
                title.classList.add("data")

                const usaVote = document.createElement("p")
                usaVote.textContent = resolution.USAVote
                usaVote.classList.add(resolution.USAClass)
                usaVote.classList.add("data")

                const euVote = document.createElement("p")
                euVote.textContent = resolution.EUVote
                euVote.classList.add(resolution.EUClass)
                euVote.classList.add("data")

                table.appendChild(title)
                table.appendChild(usaVote)
                table.appendChild(euVote)
            })
            const headerElement = document.querySelector("#metaDataYear > p:first-of-type")
            let headerText = `United Nations General Assembly Session ${dataOfYear[0].Session}`
            headerElement.textContent = headerText

            const year = document.querySelector("#year")
            year.textContent = dataOfYear[0].Session + 1945

            const amountOfResolutions = document.querySelector("#amountOfResolutions")
            amountOfResolutions.textContent = dataOfYear.length

            const percentage = getPercentage(data, beginYear, endYear).find((item) => item.year == bar.id).percentage
            const percentageElement = document.querySelector("#percentage")
            percentageElement.textContent = `${Math.round(percentage)} %`

            parentElement.style.display = "flex"
        })
    })
    removeMetaDataYear()
}

function removeMetaDataYear() {
    const exitButton = document.querySelector("#metaDataYear #exit")
    exitButton.addEventListener(("click"), () => {
        const oldData = document.querySelectorAll(".data")
        oldData.forEach((element) => {
            element.remove()
        })
        const metaDataYear = document.querySelector("#metaDataYear")
        metaDataYear.style.display = "none"
    })
}

function addEvents(data, beginYear) {
    const parentElement = document.querySelector("#events")
    let number = 0
    let eventHeight = 4
    let flexGap = .75
    if(window.innerWidth < 700){eventHeight = 2.5}else{eventHeight = 4}
    window.addEventListener('resize', () => {
        if(window.innerWidth < 700){eventHeight = 2.5}else{eventHeight = 4}
        const events = document.querySelectorAll(".event")
        events.forEach((event) => {
            event.style.top = `${(event.id - beginYear) * (eventHeight + flexGap)}em`
        })
    })
    // the voting data doesn't go to 2023 so the last event should be displayed.
    data.pop() // remove this line when you get the data until atleast 2022 fixed
    data.forEach((event) => {
        const eventElement = document.createElement("img")
        eventElement.style.top = `${(event.year - beginYear) * (eventHeight + flexGap)}em`
        eventElement.id = event.year
        eventElement.src = `./img/${event.img}`
        eventElement.classList.add("event")

        parentElement.appendChild(eventElement)
        number += 1
    })
}

function showMetaDataEvent(data) {
    const events = document.querySelectorAll(".event")
    const container = document.querySelector("#metaDataEvent")
    const exitButton = document.querySelector("#metaDataEvent #exitButton")
    events.forEach((event) => {
        event.addEventListener("click", () => {
            const eventData = data.find(item => item.year == event.id)
            console.log(eventData)

            const img = document.querySelector("#metaDataEvent img")
            img.src = `./img/${eventData.img}`

            const h2 = document.querySelector("#metaDataEvent h2")
            h2.textContent = eventData.title

            const p = document.querySelector("#metaDataEvent p")
            p.textContent = eventData.description

            container.style.display = "flex"
        })

        exitButton.addEventListener("click", () => {
            container.style.display = "none"
        })
    })
}

function sortResolutions(data, order) {
    const sameVotes = data.filter(item => item.USAVote === item.EUVote)
    const differentVotes = data.filter(item => item.USAVote !== item.EUVote)

    if(order === "agreed") {
        const sortedItems = [...sameVotes, ...differentVotes]
        return sortedItems
    } else {
        const sortedItems = [...differentVotes, ...sameVotes]
        return sortedItems
    }
}

function changeResolutionOrder() {
    const selectElement = document.querySelector("#sort")
    selectElement.addEventListener("change", () => {
        changeMetaDataYear()
      })
}

